pf = {};
pf.view = {};
pf.viewmodel = {};
pf.modules = {};

$(document).ready(function () {
    loadModules();
});

function loadModules() {
    pf.modules.map.init();
    pf.modules.imsiTable.init();
}
(function ($, pf, L) {
    pf.modules.map = {};
    $.extend(pf.modules.map, {

        init: function () {
            this.setDom();
            this.buildMap();
            this.addOsmLayer();
        },


        setDom: function () {
            pf.view.$map = $('#map');
        },


        buildMap: function () {
            pf.viewmodel.map = L.map('map').setView([-26.017, 139.219], 4);
        },


        addOsmLayer: function () {
            L.tileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
                attribution: 'Map data  <a href="http://openstreetmap.org">OpenStreetMap</a> contributors',
                maxZoom: 18
            }).addTo(pf.viewmodel.map);
        }
    });
}(jQuery, pf, L));
(function ($, pf, L) {
    pf.modules.imsiTable = {};
    $.extend(pf.modules.imsiTable, {

        init: function () {
            this.setDom();
            this.buildTable();
            this.overwriteJTableMethods();
        },


        setDom: function () {
            pf.view.$imsiTable = $('#imsiTable');
        },


        buildTable: function () {
            pf.view.$imsiTable.jtable({
                actions: {},
                fields: {
                    imsi: {
                        title: 'IMSI'
                    },
                    last_lur: {
                        title: 'Last LUR (minutes ago)'
                    }
                }
            });
            pf.viewmodel.imsiTable = pf.view.$imsiTable.data('hik-jtable');
        },

        overwriteJTableMethods: function () {
            pf.viewmodel.imsiTable._showError = function () {};
        }
    });
}(jQuery, pf, L));